package javacode;

import java.util.Scanner;

public class Swapnumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub


		int a=25;
		int b=20;
		int temp;
		
		System.out.println(a + " "+ b);
		
		temp=a;
		a=b;
		b=temp;
		
		System.out.println(a+ " "+ b);

	

	}

}
